    def mod_chosen_dropdown(self, event):
        model = self.mod_hash[self.mod_chosen.get()]

        for i in self.shelters_data:

            df_use = self.iso_data[i]
            if df_use['OCCUPANCY_RATE_ROOMS'].isna().all():
                df_use = df_use.rename(columns = {'OCCUPANCY_RATE_BEDS': 'OCCUPIED_PERCENTAGE'})
            else:
                df_use = df_use.rename(columns = {'OCCUPANCY_RATE_ROOMS': 'OCCUPIED_PERCENTAGE'})

            if self.mod_chosen.get() == 'Univariate LSTM':
                self.shelters_data[i] = [df_use, dl.infer_date_(model, df_use[['OCCUPANCY_DATE', 'OCCUPIED_PERCENTAGE']], self.scaler, 1, 60)]
            if self.mod_chosen.get() == 'City wide Multivariate LSTM':
                self.shelters_data[i] = [df_use, dl.infer_date_(model, df_use[['OCCUPANCY_DATE', 'OCCUPIED_PERCENTAGE']], self.scaler, 60, 60)]
            if self.mod_chosen.get() == 'Correlation Grouping LSTM':
                self.shelters_data[i] = [df_use, dl.infer_date_(model, df_use[['OCCUPANCY_DATE', 'OCCUPIED_PERCENTAGE']], self.scaler, 60, 60, [self.corr_group[i], max(self.corr_group.values()) + 1])]
        self.change_data_and_title()

    def download_data(self):
        # Iterate over each key-value pair in the hashmap
        for program_id, dataframes in self.shelters_data.items():
            # Extract dataframes
            current_df, future_df = dataframes
            
            # Save current dataframe to CSV
            current_filename = f"shelter_{program_id}_current.csv"
            current_df.to_csv(current_filename, index=False)
            
            # Save future dataframe to CSV
            future_filename = f"shelter_{program_id}_future.csv"
            future_df.to_csv(future_filename, index=False)

    def view_graph_fn(self):

        for i in self.chosen_shell_list:
            try:
                #Prepping Current Data
                temp_df = self.shelters_data[int(i)][0].copy()
                if self.start_date_var is not None or self.end_date_var is not None:
                    temp_df = temp_df[temp_df["OCCUPANCY_DATE"] >= self.start_date_var]
                    temp_df = temp_df[temp_df["OCCUPANCY_DATE"] <= self.end_date_var]

                #Prepping Future Data
                future_df = self.shelters_data[int(i)][1].copy()
                if self.start_date_var is not None or self.end_date_var is not None:
                    future_df = future_df[future_df["OCCUPANCY_DATE"] >= self.start_date_var]
                    future_df = future_df[future_df["OCCUPANCY_DATE"] <= self.end_date_var]

                # Plot data for current shelter and add label
                if self.graph_ind and self.program_id_2_var.get() != "":
                    if int(i) == int(self.program_id_2_var.get()):
                        label = 'Chosen Shelter'
                        label2 = f'Future Data of {i}'
                        plt.plot(temp_df['OCCUPANCY_DATE'], temp_df['OCCUPIED_PERCENTAGE'], label=label, color = 'red', zorder = len(self.chosen_shell_list) + 1)
                        plt.plot(future_df['OCCUPANCY_DATE'], future_df['OCCUPIED_PERCENTAGE'], label=label2, color = 'orange', zorder = len(self.chosen_shell_list) + 1)
                    else:
                        plt.plot(temp_df['OCCUPANCY_DATE'], temp_df['OCCUPIED_PERCENTAGE'], color = 'blue')
                else:
                    label = f'Shelter {i}'
                    label2 = f'Future Data of {i}'
                    plt.plot(temp_df['OCCUPANCY_DATE'], temp_df['OCCUPIED_PERCENTAGE'], label=label)
                    plt.plot(future_df['OCCUPANCY_DATE'], future_df['OCCUPIED_PERCENTAGE'], label=label2)
            except:
                pass

        plt.title("Shelter Occupancy Rates")
        plt.ylabel('Occupancy Rates (%)')
        plt.xlabel('Dates')
        plt.show()

