    def change_data_and_title(self):
        # Clear the previous plot
        self.ax.clear()

        # Plot new data for each selected shelter
        for i in self.chosen_shell_list:
            try:
                #Prepping Current Data
                temp_df = self.shelters_data[int(i)][0].copy()
                if self.start_date_var is not None or self.end_date_var is not None:
                    temp_df = temp_df[temp_df["OCCUPANCY_DATE"] >= self.start_date_var]
                    temp_df = temp_df[temp_df["OCCUPANCY_DATE"] <= self.end_date_var]

                #Prepping Future Data
                future_df = self.shelters_data[int(i)][1].copy()
                if self.start_date_var is not None or self.end_date_var is not None:
                    future_df = future_df[future_df["OCCUPANCY_DATE"] >= self.start_date_var]
                    future_df = future_df[future_df["OCCUPANCY_DATE"] <= self.end_date_var]

                # Plot data for current shelter and add label
                if self.graph_ind and self.program_id_2_var.get() != "":
                    if int(i) == int(self.program_id_2_var.get()):
                        label = 'Chosen Shelter'
                        label2 = f'Future Data of {i}'
                        self.ax.plot(temp_df['OCCUPANCY_DATE'], temp_df['OCCUPIED_PERCENTAGE'], label=label, color = 'red', zorder = len(self.chosen_shell_list) + 1)
                        self.ax.plot(future_df['OCCUPANCY_DATE'], future_df['OCCUPIED_PERCENTAGE'], label=label2, color = 'orange', zorder = len(self.chosen_shell_list) + 1)
                    else:
                        self.ax.plot(temp_df['OCCUPANCY_DATE'], temp_df['OCCUPIED_PERCENTAGE'], color = 'blue')
                else:
                    label = f'Shelter {i}'
                    label2 = f'Future Data of {i}'
                    self.ax.plot(temp_df['OCCUPANCY_DATE'], temp_df['OCCUPIED_PERCENTAGE'], label=label)
                    self.ax.plot(future_df['OCCUPANCY_DATE'], future_df['OCCUPIED_PERCENTAGE'], label=label2)
            except:
                pass

        # Configure plot
        self.ax.xaxis_date()
        self.ax.set_title("Shelter Occupancy Rates", color = self.theme_bold)
        self.ax.set_xlabel('Dates', fontsize=8, color='white')
        self.ax.set_ylabel('Occupancy Rates (%)', fontsize=8, color='white')
        for tick in self.ax.get_xticklabels():
            tick.set_color(self.theme_bold)
        for tick in self.ax.get_yticklabels():
            tick.set_color(self.theme_bold)

        # Add legend
        if len(self.chosen_shell_list) > 0:
            self.ax.legend(fontsize='small')

        # Redraw the chart
        self.chart.draw()

    def on_dropdown_select(self, event):
        # Function to execute when selection changes
        selected_program_id = self.program_id_2_var.get()
        self.org_name_str.set(str(self.iso_data[int(selected_program_id)].iloc[0, 1]))
        self.shell_group_str.set(str(self.iso_data[int(selected_program_id)].iloc[0, 2]))
        self.location_name_str.set(str(self.iso_data[int(selected_program_id)].iloc[0, 3]))
        self.location_addy_str.set(str(self.iso_data[int(selected_program_id)].iloc[0, 4]))
        self.location_postal_str.set(str(self.iso_data[int(selected_program_id)].iloc[0, 5]))
        self.location_cap_type_str.set(str(self.iso_data[int(selected_program_id)].iloc[0, 7]))

        if self.view_date_infer is not None:
            self.show_output()

    def show_output(self):
        min_date_pres = self.shelters_data[int(self.program_id_2_var.get())][0]['OCCUPANCY_DATE'].min()
        max_date_pres = self.shelters_data[int(self.program_id_2_var.get())][0]['OCCUPANCY_DATE'].max()
        min_date_future = self.shelters_data[int(self.program_id_2_var.get())][1]['OCCUPANCY_DATE'].min()
        max_date_future = self.shelters_data[int(self.program_id_2_var.get())][1]['OCCUPANCY_DATE'].max()
        if self.view_date_infer < min_date_pres.date():
            self.output_type_str.set("None (date is less than available data)")
            self.occu_rate_str.set("")
        if self.view_date_infer >= min_date_pres.date() and self.view_date_infer <= max_date_pres.date():
            self.output_type_str.set("Actual Data")
            occu = self.shelters_data[int(self.program_id_2_var.get())][0][self.shelters_data[int(self.program_id_2_var.get())][0]['OCCUPANCY_DATE'] == pd.to_datetime(self.view_date_infer)]
            self.occu_rate_str.set(str(occu.iloc[0, -2]) + "%")
        if self.view_date_infer >= min_date_future.date() and self.view_date_infer <= max_date_future.date():
            self.output_type_str.set("Predicted Data")
            occu = self.shelters_data[int(self.program_id_2_var.get())][1][self.shelters_data[int(self.program_id_2_var.get())][1]['OCCUPANCY_DATE'] == pd.to_datetime(self.view_date_infer)]
            self.occu_rate_str.set(str(occu.iloc[0, 1]) + "%")
        if self.view_date_infer > max_date_future.date():
            self.output_type_str.set("None (date exceeded predicted data)")
            self.occu_rate_str.set("")

    def AddShelter(self):
        selected_program_id = self.program_id_var.get()
        cur_len = len(self.chosen_shell_list)
        if selected_program_id != "":
            self.chosen_shell_list.append(selected_program_id)
            self.chosen_shell_list = list(set(self.chosen_shell_list))
            self.shell_chosen_count_str.set(str(len(self.chosen_shell_list)))
            self.prod_id_dropdown['values'] = self.chosen_shell_list
            if len(self.chosen_shell_list) > cur_len:

                model = self.mod_hash[self.mod_chosen.get()]

                #Pre-prep the data
                df_use = self.iso_data[int(selected_program_id)]
                if df_use['OCCUPANCY_RATE_ROOMS'].isna().all():
                    df_use = df_use.rename(columns = {'OCCUPANCY_RATE_BEDS': 'OCCUPIED_PERCENTAGE'})
                else:
                    df_use = df_use.rename(columns = {'OCCUPANCY_RATE_ROOMS': 'OCCUPIED_PERCENTAGE'})

                if self.mod_chosen.get() == 'Univariate LSTM':
                    self.shelters_data[int(selected_program_id)] = [df_use, dl.infer_date_(model, df_use[['OCCUPANCY_DATE', 'OCCUPIED_PERCENTAGE']], self.scaler, 1, 60)]
                if self.mod_chosen.get() == 'City wide Multivariate LSTM':
                    self.shelters_data[int(selected_program_id)] = [df_use, dl.infer_date_(model, df_use[['OCCUPANCY_DATE', 'OCCUPIED_PERCENTAGE']], self.scaler, 60, 60)]
                if self.mod_chosen.get() == 'Correlation Grouping LSTM':
                    self.shelters_data[int(selected_program_id)] = [df_use, dl.infer_date_(model, df_use[['OCCUPANCY_DATE', 'OCCUPIED_PERCENTAGE']], self.scaler, 60, 60, [self.corr_group[int(selected_program_id)], max(self.corr_group.values()) + 1])]
                    




